import React from 'react';
import PropTypes from 'prop-types';

function Item(props) {
  const { content } = props;
  return (
    <div className="Item">
      <button type="button">Adicionar</button>
      {content}
      <button type="button">Remover</button>
    </div>
  );
}

export default Item;

Item.propTypes = {
  content: PropTypes.string.isRequired,
};
